/** Evaluate a vector (do a dot product).
 *@param v is the vector to evaluate.
 *@return the result.
 */
public double evaluate(Vector v) {
    return this.x * v.x + this.y * v.y + this.z * v.z;
}

/** Evaluate a vector (do a dot product).
 *@param v is the vector to evaluate.
 *@return the result.
 */
public double evaluate(final Vector v) {
    return this.x * v.x + this.y * v.y + this.z * v.z;
}

